import React, {useState, useEffect} from 'react';
import { useStateValue } from '../utilities/StateProvider';
import axios from 'axios'

export default function Dashboard() {
    const[token, {dispatch}] = useStateValue()
    const [accessToken, setAccessToken] = useState()
    const [refreshToken, setRefreshToken] = useState()
    const [expiresIn, setExpiresIn] = useState()

    useEffect(() => {
        const code = 'AQA0Q-YknycdUEBCigoRXY8v8R3-YsprtKmgwBfvgq2JoB3Me9fGgq8VnsTjYGtvL_aRnBcTRB1qDE6pAFlVckjYn_EGDsqY2jpNOHK5ABCe4LIugE_eU91RECOyCtg8Ll7qseGati0HNZxDWa8AN3h9q5FVOx_C-1sEAcEpajIGMx4G8LBaKoE_1P3L5-b_ZWxnzqBBJvdro6CezEt9merwHxuz9jqrtxZJP1wF2pHdKIoFEPsn7rErrQukq0mrB9Y8b9NOulDqTma-0xC2U788q0ZXPJRLOQ9BrYBgQeob7xLvtcxxF1U54DTODy24voage4g7ZHeOnaW8XOxqR2pwsrMwxJCnpbSB-2QW5sJMT4hex1wLV7hUz3FAXdqKiJPPn54lqmz2lpXBq7f_C5YETNueMfTz0MqY'
        axios.post('http://localhost:3001/login', {
            code
        }).then((res) => {
            console.log('res :', res);
            setAccessToken(res.accessToken);
            setRefreshToken(res.refreshToken);
            setExpiresIn(res.expiresIn)
        })
    }, [token])

    return (
        <div>
            
        </div>
    )
}
